webpackJsonp([0x62912bf77ca0],{1232:function(a,t){a.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/building-bridges-some-solutions/index.md absPath of file >>> MarkdownRemark",html:'<p>In a non-too-subtle way, I thought I\'d drum up a bit more enthusiasm for <a href="http://www.mmtdigital.co.uk/Flash/ChristmasGame2009/Building_Bridges.html">this years\' Christmas Game</a>, by showing you a few of the solutions that people have come up with for the levels.</p>\n<h3>Type 1: The Basic solution.</h3>\n<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/basic-25f40a4a915661b7cbd6055688c2aa57-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="basic"\n        title=""\n        src="/static/basic-25f40a4a915661b7cbd6055688c2aa57-41a8d.png"\n        srcset="/static/basic-25f40a4a915661b7cbd6055688c2aa57-bf474.png 158w,\n/static/basic-25f40a4a915661b7cbd6055688c2aa57-d5dd3.png 315w,\n/static/basic-25f40a4a915661b7cbd6055688c2aa57-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Oh yes, it works for the first level, but just you try that on some of the later ones...</p>\n<h3>Type 2: Adding some support</h3>\n<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/secure-95a0c169d673c620d7d84d6b0b900e9d-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="secure"\n        title=""\n        src="/static/secure-95a0c169d673c620d7d84d6b0b900e9d-41a8d.png"\n        srcset="/static/secure-95a0c169d673c620d7d84d6b0b900e9d-bf474.png 158w,\n/static/secure-95a0c169d673c620d7d84d6b0b900e9d-d5dd3.png 315w,\n/static/secure-95a0c169d673c620d7d84d6b0b900e9d-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>That\'s the basic principle for solving the later levels...</p>\n<h3>Type 3: Support overkill</h3>\n<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sturdy-ad549c92fa885215046a8dc1138e1f71-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="sturdy"\n        title=""\n        src="/static/sturdy-ad549c92fa885215046a8dc1138e1f71-41a8d.png"\n        srcset="/static/sturdy-ad549c92fa885215046a8dc1138e1f71-bf474.png 158w,\n/static/sturdy-ad549c92fa885215046a8dc1138e1f71-d5dd3.png 315w,\n/static/sturdy-ad549c92fa885215046a8dc1138e1f71-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>One things\' for sure, it ain\'t goin\' down lightly.</p>\n<h3>Type 4: The Leap of Faith</h3>\n<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/leapoffaith-bd1a06107355ef1669d90850121e54e2-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="leapoffaith"\n        title=""\n        src="/static/leapoffaith-bd1a06107355ef1669d90850121e54e2-41a8d.png"\n        srcset="/static/leapoffaith-bd1a06107355ef1669d90850121e54e2-bf474.png 158w,\n/static/leapoffaith-bd1a06107355ef1669d90850121e54e2-d5dd3.png 315w,\n/static/leapoffaith-bd1a06107355ef1669d90850121e54e2-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>It doesn\'t all have to join up, you know.  You could just build ramps!</p>\n<h3>Type 5: That\'s a ropey one...</h3>\n<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ropey-8ca82a386eff761cdca50e0fab6cab33-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ropey"\n        title=""\n        src="/static/ropey-8ca82a386eff761cdca50e0fab6cab33-41a8d.png"\n        srcset="/static/ropey-8ca82a386eff761cdca50e0fab6cab33-bf474.png 158w,\n/static/ropey-8ca82a386eff761cdca50e0fab6cab33-d5dd3.png 315w,\n/static/ropey-8ca82a386eff761cdca50e0fab6cab33-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Rope bridges. Flexible, and surprisingly strong.</p>\n<h3>Type 6: The unconventional solution</h3>\n<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/unconventional-15095579fd4d96fc5ea9916ca05b9eda-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="unconventional"\n        title=""\n        src="/static/unconventional-15095579fd4d96fc5ea9916ca05b9eda-41a8d.png"\n        srcset="/static/unconventional-15095579fd4d96fc5ea9916ca05b9eda-bf474.png 158w,\n/static/unconventional-15095579fd4d96fc5ea9916ca05b9eda-d5dd3.png 315w,\n/static/unconventional-15095579fd4d96fc5ea9916ca05b9eda-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Sometimes the best solution isn\'t the most obvious.</p>\n<p>Like the look of that?  Well, go check out our <a href="http://www.mmtdigital.co.uk/Flash/ChristmasGame2009/Building_Bridges.html">Christmas Game: Building Bridges</a>, and see what you can come up with!</p>',frontmatter:{title:"Building Bridges: Some solutions",date:"December 23, 2009",tags:["flash","box2","building-bridges","christmas-game","mmt-digital"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/building-bridges-a-box2d-powered-seasonal-game/",tags:["box2d","flash","christmas-game"],title:'"Building Bridges", a Box2D - powered Seasonal Game',date:"2009-12-18T13:47:54.000Z",description:null,image:null}},next:{frontmatter:{path:"/blog/the-results-of-my-annual-code-something-different-this-christmas-idea/",tags:["actionscript","box2d"],title:'The results of my annual "code something different this Christmas" idea.',date:"2010-01-04T08:23:39.000Z",description:null,image:null}}}}}});
